// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./access/Ownable.sol";

contract OneMillionPixel is Ownable {

    // Struct
    struct Ad {
        address owner;
        uint16 x;
        uint16 y;
        uint16 width;
        uint16 height;
        string link;
        string image;
        string title;
    }

    // Variables
    address public devaddr;
    Ad[] public ads;
    uint256 public weiPixelPrice;
    uint256 public pixelsPerCell = 100;
    bool[100][100] public grid;

    // Events
    event SetDevAddress(address indexed user, address indexed newAddress);
    event SetWeiPixelPrice(address indexed user, uint256 indexed newWeiPixelPrice);
    event SetPixelsPerCell(address indexed user, uint256 indexed newPixelsPerCell);
    event SetAdOwner(uint256 indexed idx, address from, address to);
    event Buy(uint256 indexed idx, address owner, uint16 x, uint16 y, uint16 width, uint16 height, string link, string image, string title);
    event Edit(uint256 indexed idx, string link, string image, string title);
    event Destroy(uint256 indexed idx);
    event DestroyAll();

    // Constructor
    constructor(address _devaddr, uint256 _weiPixelPrice) {
        devaddr = _devaddr;
        weiPixelPrice = _weiPixelPrice;
    }

    // Dev Adresses
    function setDevAddress(address _devaddr) public onlyOwner {
        devaddr = _devaddr;
        emit SetDevAddress(msg.sender, _devaddr);
    }
    function getDevAddress() public view returns (address) {
        return devaddr;
    }

    // Price per pixel
    function setWeiPixelPrice(uint256 _weiPixelPrice) public onlyOwner {
        weiPixelPrice = _weiPixelPrice;
        emit SetWeiPixelPrice(msg.sender, _weiPixelPrice);
    }
    function getWeiPixelPrice()  public view returns (uint256) {
        return weiPixelPrice;
    }

    // Price per cell
    function setPixelsPerCell(uint256 _pixelsPerCell) public onlyOwner {
        pixelsPerCell = _pixelsPerCell;
        emit SetPixelsPerCell(msg.sender, _pixelsPerCell);
    }
    function getPixelsPerCell() public view returns (uint256){
        return pixelsPerCell;
    }

    // Owner ads
    function setAdOwner(uint256 _idx, address _newOwner) public {
        Ad storage ad = ads[_idx];
        require(msg.sender == ad.owner, 'Only owner allowed');
        ad.owner = _newOwner;

        emit SetAdOwner(_idx, msg.sender, _newOwner);
    }
    function getAdOwner(uint256 _idx) public view returns (address) {
        Ad storage ad = ads[_idx];
        return ad.owner;
    }

    // Ads length
    function getAdsLength() external view returns (uint256) {
        return ads.length;
    }

    // Buy
    function buy(uint16 _x, uint16 _y, uint16 _width, uint16 _height, string memory _link, string memory _image, string memory _title) public payable returns (uint256) {

        require(bytes(_link).length > 8, 'Link should be https://...');
        require(bytes(_image).length > 8, 'Image should be https://...');
        require(bytes(_title).length >= 3, 'Title must contain at least 3 characters');

        uint256 cost = _width * _height * pixelsPerCell * weiPixelPrice;
        require(cost > 0, 'Cost is NULL');
        require(msg.value >= cost, 'Cost too low');

        // Loop over relevant grid entries
        for(uint16 i=0; i<_width; i++) {
            for(uint16 j=0; j<_height; j++) {
                if (grid[_x+i][_y+j]) {
                    // Already taken, undo.
                    revert('Not allowed');
                }
                grid[_x+i][_y+j] = true;
            }
        }

        // We reserved space in the grid, now make a placeholder entry.
        Ad memory ad = Ad(msg.sender, _x, _y, _width, _height, _link, _image, _title);
        ads.push(ad);
        uint256 idx = ads.length - 1;
        emit Buy(idx, msg.sender, _x, _y, _width, _height, _link, _image, _title);
        return idx;
    }

    // Edit
    function edit(uint256 _idx, string memory _link, string memory _image, string memory _title) public {
        Ad storage ad = ads[_idx];
        require(msg.sender == ad.owner, 'Only owner allowed');

        // https:// is 8 length
        if(bytes(_link).length > 8){
            ad.link = _link;
        }
        // https:// is 8 length
        if(bytes(_image).length > 8){
            ad.image = _image;
        }
        // min 3 char for title
        if(bytes(_title).length >= 3){
            ad.title = _title;
        }

        emit Edit(_idx, ad.link, ad.image, ad.title);
    }

    // Edit
    function editByAdmin(uint256 _idx, string memory _link, string memory _image, string memory _title) public onlyOwner{
        Ad storage ad = ads[_idx];

        // https:// is 8 length
        if(bytes(_link).length > 8){
            ad.link = _link;
        }
        // https:// is 8 length
        if(bytes(_image).length > 8){
            ad.image = _image;
        }
        // min 3 char for title
        if(bytes(_title).length >= 3){
            ad.title = _title;
        }

        emit Edit(_idx, ad.link, ad.image, ad.title);
    }

    // Destroy
    function destroy(uint256 _idx) public onlyOwner{
        delete ads[_idx];
        emit Destroy(_idx);
    }

    // Destroy All
    function destroyAll() public onlyOwner{
        delete ads;
        emit DestroyAll();
    }

    // withdraw
    function withdraw() public payable onlyOwner {
        payable(devaddr).transfer(address(this).balance);
    }
}
